import React from "react";
import "./AppFilter.css  "

function AppFilter(){
    return(
        <div className="btnBlock">
            <button className="btn btnLight" type="button">
                Все сотрудники
            </button>
            <button className="btn btnOutlineLight " type="button">
                На повышение
            </button>
            <button className="btn btnOutlineLight" type="button">
                З/П больше 1000$
            </button>
        </div>
    )
}
export default AppFilter;
